import { BrowserRouter, Route, Routes } from 'react-router-dom';
import './App.css';
import Home from '../home/home';
import Navbar from '../navfoot/navbar';
function App() {
  return (
    <>
    <Navbar/>
    <BrowserRouter>
    <Routes>
      <Route path='/' element={<Home/>}/>

    </Routes>
    </BrowserRouter>
    <h1>Hello</h1>
    </>
  );
}

export default App;
